import { Link } from "react-router-dom"
import { isAuthenticated } from "../services/Auth"
import "./NavbarFire.css"
export default function Nav(props){


    return ( <nav className="navbar navbar-expand-lg navbar-dark bg-info static-top">
                   <div className="container">
                   <a className="navbar-brand" href="#"><img className="imgfire" src="logobook.png" alt="logo"/></a>

                   </div>
      
                <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarsExampleDefault" aria-controls="navbarsExampleDefault" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarsExampleDefault">
                    <div className="collapse navbar-collapse" id="navbarsExampleDefault">
                    <ul className="navbar-nav mr-auto"  >
                        {!isAuthenticated()?<li className="nav-item lifire"><Link className="nav-link" to="/register">Register</Link></li>:null}
                        {!isAuthenticated()?<li><Link className="nav-link  " to="/login" >Login</Link></li>:null}
                        {isAuthenticated()?<li className="nav-item"><Link className="nav-link " to="/dashboard" >Dashboard</Link></li>:null}
                        {isAuthenticated()?<li><a className="nav-link "  onClick={props.logoutUser} style={{cursor:"pointer"}} >Logout</a></li>:null}
                    </ul>

                    </div>
                 
                </div>
            </nav>)
}
